def compile_level(level):
    Barrier.instances = []
    x = 0
    y = 0
    for row in level:
        for col in row:
            if col == "E":
                Barrier("Blank", x, y)
            elif col == " ":
                continue
            x += 1
        y += 1
        x = 0
